var env = setup(env);

/************************* Testing *************************/
 
// Default tests

tests["Status code is 200"] = responseCode.code === 200;
tests["Response time is less than 5000ms"] = responseTime < 5000;

// Data validation tests

var data = JSON.parse(responseBody);

var response =  data.responses.response;

testNotEmpty("the body", "response", response);
 
if (!_.isEmpty(response)) {

    var i = 0;
    _.forEach(response, function(element) {

        //testNotEmpty("element #" + i, "@class", element['@class']);
        testNotEmpty("element #" + i, "@code", element['@code']);
        testNotEmpty("element #" + i, "@name", element['@name']);
        testNotEmpty("element #" + i, "@uuid", element['@uuid']);

        testNotEmpty("element #" + i, "getPhoneDetailsResponse", element.getPhoneDetailsResponse);

        if (!_.isEmpty(element.getPhoneDetailsResponse)) {

            testNotEmpty("getPhoneDetailsResponse", "description", element.getPhoneDetailsResponse.description);
            testNotEmpty("getPhoneDetailsResponse", "status", element.getPhoneDetailsResponse.status);

            testNotEmpty("getPhoneDetailsResponse", "phoneDetails", element.getPhoneDetailsResponse.phoneDetails);
            var pdetails = element.getPhoneDetailsResponse.phoneDetails.phoneDetail;

            if (!_.isEmpty(pdetails)) {

                testNotEmpty("phone details", "phoneName", pdetails.phoneName);

                var testPrefix;
                if (!_.isEmpty(pdetails.phoneName)) {
                    testPrefix = pdetails.phoneName['$'];
                } else {
                    testPrefix = "phone details";
                }

                testNotEmpty(testPrefix, "manufacturerName", pdetails.manufacturerName);
                testNotEmpty(testPrefix, "extendedDescription", pdetails.extendedDescription);
                //testNotEmpty(testPrefix, "associatedAccessoryId", pdetails.associatedAccessoryId);

                testNotEmpty(testPrefix, "isRedVentures", pdetails.isRedVentures);
                //testNotEmpty(testPrefix, "disclaimerMini", pdetails.disclaimerMini);
                //testNotEmpty(testPrefix, "disclaimerFull", pdetails.disclaimerFull);

                testNotEmpty(testPrefix, "phoneViewImages", pdetails.phoneViewImages);

                if (!_.isEmpty(pdetails.phoneViewImages)) {

                    _.forEach(pdetails.phoneViewImages.phoneViewImage, function(img) { 
                        testNotEmpty(testPrefix, "fileName", img.fileName);
                        testNotEmpty(testPrefix, "uRI", img.uRI);
                    });
                }

                testNotEmpty(testPrefix, "phoneVariants", pdetails.phoneVariants);

                if(!_.isEmpty(pdetails.phoneVariants)) {

                    var k = 0;
                    _.forEach(pdetails.phoneVariants, function(phoneVariant) {

                        testPrefix = testPrefix + " phoneVariant #"  + k;

                        testNotEmpty(testPrefix, "sku", phoneVariant.sku);
                        testNotEmpty(testPrefix, "price", phoneVariant.price);
                        testNotEmpty(testPrefix, "inventory", phoneVariant.inventory);

                        testNotEmpty(testPrefix, "purchaseLimit", phoneVariant.purchaseLimit);
                        testNotEmpty(testPrefix, "hiddenPrice", phoneVariant.hiddenPrice);

                        //testNotEmpty(testPrefix, "memoryVariant", phoneVariant.memoryVariant);
                        //testNotEmpty(testPrefix, "colorVariant", phoneVariant.colorVariant);
                        //testNotEmpty(testPrefix, "grandientColor", phoneVariant.grandientColor);

                        testNotEmpty(testPrefix, "shopGridPicture", phoneVariant.shopGridPicture);
                        if (!_.isEmpty(phoneVariant.shopGridPicture)) {
                            testNotEmpty(testPrefix + " shopGridPicture", "fileName", phoneVariant.shopGridPicture.fileName);
                            testNotEmpty(testPrefix + " shopGridPicture", "uRI", phoneVariant.shopGridPicture.uRI);
                        }

                        testNotEmpty(testPrefix, "heroImage", phoneVariant.heroImage);
                        if (!_.isEmpty(phoneVariant.heroImage)) {
                            testNotEmpty(testPrefix + " heroImage", "fileName", phoneVariant.heroImage.fileName);
                            testNotEmpty(testPrefix + " heroImage", "uRI", phoneVariant.heroImage.uRI);
                        }

                        k = k +1;
                    });

                }

                testNotEmpty(testPrefix, "meta", pdetails.meta);
                if(!_.isEmpty(pdetails.meta)) { 
                    testNotEmpty(testPrefix + " meta", "title", pdetails.meta.title);
                    testNotEmpty(testPrefix + " meta", "description", pdetails.meta.description);
                    testNotEmpty(testPrefix + " meta", "keywords", pdetails.meta.keywords);
                }
            }

        }

        i = i + 1;
    });

}


/********************* Tests Teardown **********************/

// Post-testing formatting
teardown();


